import React from 'react';
import AuthPage from './pages/auth_form';

const App = () => {
  return (
    <div>
      <h1>Welcome to AllGoodsHub</h1>
    </div>
  );
};

<Switch>
  <Route exact path="/auth" component={AuthPage} />
</Switch>

export default App;
